<!DOCTYPE html><html lang="en"><head>
  <meta charset="UTF-8">
  <meta name="viewport" content="width=device-width, initial-scale=1.0">
  <meta http-equiv="X-UA-Compatible" content="ie=edge">
  <title>swimming pool的地理位置</title>
  <style>
    body {
      height: 100vh;
      margin: 0;
      font-family: 'Source Sans Pro', sans-serif;
    }
    .legend {
      position: absolute;
      top: 0.65rem;
      left: 0.65rem;
      padding: 0.45rem 0.75rem;
      border: 1px solid #fff;
      border-radius: 4px;
      z-index: 1;
      background: rgba(255, 255, 255, 0.8);
      user-select: none;
      -ms-user-select: none;
      -moz-user-select: none;
      -webkit-user-select: none;
    }
    @media screen and (max-width: 720px) {
        .legend {
          transform: scale(0.8);
          transform-origin: top left;
        }
    }
    .legend h1 {
      padding: 0;
      margin: 0;
      margin-bottom: 0.25rem;
      font-size: 1rem;
      font-weight: 800;
    }

    .legend ul {
      list-style-type: none;
      margin: 0;
      padding: 0;
    }

    .legend li {
      font-size: 0.9rem;
      line-height: 1.5rem;
      margin: 0.25rem 0;
      cursor: pointer;
      display: flex;
      align-items: center;
    }

    .legend li:last-child {
      margin-bottom: 0;
    }

    .legend li:hover {
      opacity: 0.8;
    }

    .legend li.hidden {
      opacity: 0.4;
    }

    .legend li.hidden:hover {
      opacity: 0.6;
    }

    .legend .category-icon {
      display: inline-block;
      width: 1.1rem;
      height: 1.1rem;
      line-height: 1.1rem;
      font-size: 0.8rem;
      margin-right: 0.35rem;
      text-align: center;

      background-position: center center;
      background-size: contain;
      background-repeat: no-repeat;
    }

    .marker-text {
      z-index: 1;
      position: absolute;
      top: 50%; left: 100%;
      margin-left: 0.5rem;
      display: inline-block;
      font-size: 0.8rem;
      line-height: 1.1em;
      font-weight: 700;
      max-width: 300px;
      color: #000;
      background: attr(data-background);
      text-align: left;
      transform: translate(0, -50%);
      z-index: -1;
    }
    .flourish-popup {
      pointer-events: none;
    }
    .flourish-popup-content {
      max-width: 220px !important;
      min-width: 180px;
      pointer-events: all;
    }

    .flourish-popup-content img {
      width: 100%;
      margin-bottom: 5px;
      margin-left: 0;
      margin-right: 0;
      border-radius: 3px 3px 0 0;
    }

    .flourish-popup-content img[src=""] {
      display: none;
    }

    .flourish-popup-content p {
      margin: 0;
    }

    .flourish-popup-content h1:empty, .flourish-popup-content h2:empty, .flourish-popup-content p:empty {
        margin: 0;
    }

    .mapboxgl-map {
      position: absolute;
      top: 0; left: 0;
      width: 100%; height: 100%;
    }
  </style>
</head>
